import React from "react";
import "./Frame5.css";

function Frame5(props) {
  const { cancel, className } = props;

  return (
    <div className={`frame-5 border-0-5px-quarter-spanish-white ${className || ""}`}>
      <div className="cancel valign-text-middle ibmplexsans-semi-bold-quarter-spanish-white-16px">{cancel}</div>
    </div>
  );
}

export default Frame5;
